// src/pages/MyAds.jsx
import React, { useState } from "react";
import Sidebar from "../components/Sidebar";
import Footer from "../components/Footer";
import { FaTrash, FaShoppingCart } from "react-icons/fa";

const MyAds = () => {
  const [sidebarOpen, setSidebarOpen] = useState(true);

  // Dummy data for the table
  const adsData = [
    {
      id: 1,
      image: "https://via.placeholder.com/80",
      item: "Luxury Apartment",
      date: "12 Feb 2025 - 3:45 PM",
      tag: "For Sale",
      category: "üè† Apartment",
      price: "$1200",
      status: "Active",
    },
    {
      id: 2,
      image: "https://via.placeholder.com/80",
      item: "Villa Beachside",
      date: "09 Feb 2025 - 1:20 PM",
      tag: "For Rent",
      category: "üè° Villa",
      price: "$5000",
      status: "Inactive",
    },
    {
      id: 3,
      image: "https://via.placeholder.com/80",
      item: "Office Space 12A",
      date: "05 Feb 2025 - 11:10 AM",
      tag: "For Sale",
      category: "üåÜ Office",
      price: "$2000",
      status: "Closed",
    },
  ];

  // Status Colors
  const statusColors = {
    Active: "text-green-400 bg-green-900/40",
    Inactive: "text-yellow-400 bg-yellow-900/40",
    Closed: "text-red-400 bg-red-900/40",
  };

  return (
    <div className="min-h-screen bg-[#0a1124] pt-10">
      <div className="flex flex-col md:flex-row gap-6 max-w-6xl mx-auto">

        {/* LEFT SIDEBAR */}
        <Sidebar sidebarOpen={sidebarOpen} setSidebarOpen={setSidebarOpen} />

        {/* RIGHT CONTENT */}
        <div className="flex-1 bg-[#111827] p-8 rounded-xl shadow-lg text-white">
          <h2 className="text-xl font-semibold mb-6">My Ads</h2>

          <div className="overflow-x-auto">
            <table className="min-w-full border border-gray-700 rounded-lg overflow-hidden">
              
              {/* TABLE HEAD */}
              <thead className="bg-gray-800 text-gray-300">
                <tr>
                  <th className="px-4 py-3 border-b border-gray-700">Item</th>
                  <th className="px-4 py-3 border-b border-gray-700">Category</th>
                  <th className="px-4 py-3 border-b border-gray-700">Price</th>
                  <th className="px-4 py-3 border-b border-gray-700">Status</th>
                  <th className="px-4 py-3 border-b border-gray-700">Action</th>
                </tr>
              </thead>

              {/* TABLE BODY */}
              <tbody>
                {adsData.map((ad) => (
                  <tr key={ad.id} className="hover:bg-gray-900 border-b border-gray-700">

                    {/* ITEM COLUMN */}
                    <td className="px-4 py-4 flex items-center gap-4">
                      <img
                        src={ad.image}
                        alt={ad.item}
                        className="w-16 h-16 rounded-lg object-cover border border-gray-700"
                      />

                      <div>
                        <h3 className="font-semibold">{ad.item}</h3>
                        <p className="text-sm text-gray-400">{ad.date}</p>

                        {/* TAG */}
                        <span className="text-xs mt-1 inline-block bg-blue-600 px-2 py-1 rounded-md">
                          {ad.tag}
                        </span>
                      </div>
                    </td>

                    {/* CATEGORY */}
                    <td className="px-4 py-4 text-gray-300">{ad.category}</td>

                    {/* PRICE */}
                    <td className="px-4 py-4 font-semibold text-blue-400">
                      {ad.price}
                    </td>

                    {/* STATUS */}
                    <td className="px-4 py-4">
                      <span
                        className={`px-3 py-1 rounded-lg text-xs font-semibold ${statusColors[ad.status]}`}
                      >
                        {ad.status}
                      </span>
                    </td>

                    {/* ACTION BUTTONS */}
                    <td className="px-4 py-4 flex items-center gap-3">

                      {/* BUY NOW */}
                      <button className="bg-green-600 hover:bg-green-700 px-3 py-2 rounded-lg text-white flex items-center gap-2">
                        <FaShoppingCart size={14} /> Buy Now
                      </button>

                      {/* DELETE */}
                      <button className="bg-red-600 hover:bg-red-700 px-3 py-2 rounded-lg text-white flex items-center">
                        <FaTrash size={14} />
                      </button>

                    </td>

                  </tr>
                ))}
              </tbody>
            </table>
          </div>
        </div>

      </div>

      <Footer />
    </div>
  );
};

export default MyAds;
